    width:'60%',
    maxWidth: '100%',
    
}

const LoginDialog = () =>
{
    return(
        <Dialog
        open = {true}
        PaperProps = {{sx:dialogStyle}}>
            Hello
        </Dialog>
    )
}

export default LoginDialog;
